css:
@-moz-document domain("urbandictionary.com") {
#urban-top-bar {
    background-color: transparent;
    background: rgba(10, 10, 10, 0.65) url(http://vignette1.wikia.nocookie.net/kallenbearrp/images/c/cc/Water_stucco_wall_texture_seamless.jpg/revision/latest?cb=20160113115148) !important;
}

.top-bar {
    background: url(http://vignette2.wikia.nocookie.net/kallenbearrp/images/c/c1/Metal_tile5.png/revision/latest?cb=20160113115126);
    overflow: visible;
}

.def-panel {
    border-color: black;
    background: url(http://vignette4.wikia.nocookie.net/kallenbearrp/images/5/51/Googletile.png/revision/latest?cb=20160113083017);
    background-repeat: repeat !important;
    color: gray;
    box-shadow: 1px 1px 2px #BBB;
}

#urban-top-bar .top-bar-section .dropdown {
    box-shadow: 0 2px 0 black;
    border: 1px solid gray;
    border-radius: 5px;
    background-color: rgba(10, 10, 10, 0.65);
}

#urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li a, #urban-top-bar .top-bar-section .dropdown.alphabet-dropdown li span {
    text-align: center;
    background: url(http://vignette4.wikia.nocookie.net/kallenbearrp/images/5/51/Googletile.png/revision/latest?cb=20160113083017);
    color: #134FE6;
    border-radius: 50%;
    width: 40px;
    height: 40px;
    line-height: 40px;
    margin: 9px;
    padding: 0;
}

.tags-panel {
    box-shadow: 1px 1px 2px #BBB;
    border-color: #BBB;
    background: url(http://vignette4.wikia.nocookie.net/kallenbearrp/images/5/51/Googletile.png/revision/latest?cb=20160113083017);
    background-repeat: repeat !important;
    color: gray;
}

body {
    background: url(http://vignette2.wikia.nocookie.net/kallenbearrp/images/7/73/Seamless-leather-texture5.jpg/revision/latest?cb=20160113115101);
    background-repeat: repeat !important;
    color: gray;
}

.def-panel .meaning, .def-panel .example {
    color: lightslategray;
}

.panel {
    background: url(http://vignette4.wikia.nocookie.net/kallenbearrp/images/5/51/Googletile.png/revision/latest?cb=20160113083017);
    background-repeat: repeat !important;
    color: lightslategray;
    box-shadow: 1px 1px 2px #BBB;
}

.def-footer a {
    background-color: #BBB;
    color: #000000;
}

.def-panel .thumbs .down, .def-panel .thumbs .up {
    background-color: #BBB;
}

.copyright, .copyright a {
    color: lightslategray;
}

ul.pagination li a, ul.pagination li button {
    color: lightslategray;
}

.def-panel .ribbon {
    background-color: rgba(255, 165, 0, 0.60);
    color: black;
}

.slogan-container .word, #slogan-hidden .word {
    background-color: rgba(255, 165, 0, 0.60);
    color: black;
}

.slogan-panel .like_buttons a:hover {
    color: #05ff56;
}

.slogan-panel .like_buttons a {
    box-shadow: 1px 1px 2px #DBDBDB;
    padding: 10px 0;
    display: block;
    background: url(http://vignette2.wikia.nocookie.net/kallenbearrp/images/c/c1/Metal_tile5.png/revision/latest?cb=20160113115126);
    text-align: center;
    text-transform: uppercase;
    font-weight: bold;
    font-size: 0.8125rem;
    color: #B4B8C0;
}


}
